import React, { useState } from "react";
import "./Add.css";
import logo from './divumimages.png';
import axios from "axios";
import { useNavigate } from "react-router-dom";
function Add() {
  const [email, setEmail] = useState("");
  const [firstname, setFirstname] = useState("");
  const [lastname, setLastname] = useState(" ");
  const [mobile, setMobile] = useState(" ");
  const [dob, setDob] = useState(" ");
  const [address, setAddress] = useState(" ");
  const navigate = useNavigate();

  const date = new Date();
  let day =
    date.getDate() < 10 ? "0" + date.getDate() : date.getDate().toString();
  let mon =
    date.getMonth() + 1 < 10
      ? "0" + (date.getMonth() + 1)
      : (date.getMonth() + 1).toString();
  let year = date.getFullYear().toString();

  let currentDate = year + "-" + mon + "-" + day;


  function add() {
    const url =
      "http://localhost:5050/api/call/userinfo/add/" +
      email +
      "/" +
      firstname +
      "/" +
      lastname +
      "/" +
      mobile +
      "/" +
      dob.slice(8,10)+
      "-" +
      dob.slice(5, 7) +
      "-" +
      dob.slice(0, 4) +
      "/" +
      address +
      "/";
    axios
      .post(url)
      .then((res) => console.log("inserted"))
      .catch((error) => console.log(error));
  }

  return (

    <div className="add_mainlayout">

      <div className="innerlayout">
        <form
          onSubmit={() => {
            add();
            navigate("/");
          }}
        >
          <h1>ADD</h1>
          <div className="addcontent">
            <div className="part1">
              <label>email</label>
              <div>
                <label>Firstname</label>
              </div>
              <div>
                <label>Lastname</label>
              </div>
              <div>
                <label>Mobilenumber</label>
              </div>
              <div>
                <label>Date of Birth</label>
              </div>
              <div>
                <label>Address</label>
              </div>
            </div>
            <div className="part2">
              <input
                type="text"
                placeholder="email"
                className="email"
                onChange={(e) => {
                  setEmail(e.target.value);
                }}
              />
              <div>
                <input
                  type="text"
                  placeholder="firstname"
                  onChange={(e) => {
                    setFirstname(e.target.value);
                  }}
                />
              </div>
              <div>
                <input
                  type="text"
                  placeholder="lastname"
                  onChange={(e) => {
                    setLastname(e.target.value);
                  }}
                />
              </div>
              <div>
                <input
                  type="number"
                  placeholder="mobilenumber"
                  onChange={(e) => {
                    setMobile(e.target.value);
                  }}
                />
              </div>
              <div>
                <input
                  type="date"
                  min="1980-01-01"
                  max={currentDate}
                  onChange={(e) => {
                    setDob(e.target.value.toString());
                  }}
                />
              </div>
              <div className="textarea">
                <textarea
                  type="text"
                  maxLength="50"
                  rows="3"
                  cols="30"
                  onChange={(e) => {
                    setAddress(e.target.value);
                  }}
                />
              </div>
            </div>
          </div>
          <div className="dsubmit">
            <input type="submit" />
          </div>
        </form>
      </div>
    </div>
  );
}
export default Add;
